import React from 'react';
import './App.css';

//import { Router } from 'express'; //default

// import Router
import { BrowserRouter as Router, Route, Switch } from "react-router-dom";

// import Pages
import Home from "./Pages/Home";

function App() {
  return (
    <React.StrictMode>
      <Router>
        <Header />
          <Switch>
            <Route exact path="/" component={Home} />
          </Switch>
        <Footer />
      </Router>
    </React.StrictMode>
  );
}
